    const { cart } = props.context;
    const itemKey = Object.keys(cart || {});
    console.log(itemKey);
    console.log(cart);
    return (<div>
        {
            itemKey.map((item, index) => (
                <div key={index}>
                    {cart.item}
                </div>
            ))

        }
    </div>)
}

export default withContext(Cart);
